import { useEffect, useState } from "react";
import api from "../services/api.js";
import Container from '@mui/material/Container';
import styled from "styled-components";

const Box = styled.div`
  display: flex;
  margin: 20px 20px;
`
const Box2 = styled.div`
position:  relative;
left: 400px
`

const Box3 = styled.div`
position:  relative;
left: 400px
`

function Usuarios(params) {
  const [users, setUsers] = useState([]);

  useEffect(() => {
    api.get("users").then((response) => {
      console.log("motor", response.data);
      setUsers(response.data);
    });
  }, []);

  return (
    
      <Container sx={{ width:'1500px', height:"500px", flexDirection: 'row' ,alignItems:'center' , justifyContent: 'space-between', position:'relative', top:'200px' }}>
        
        {users.map((user) => (
          <Box>

            <Box3 key={user.id}>Name : {user.name}</Box3>
            <Box2 key={user.id}>Email: {user.email}</Box2>
            
          </Box>
        ))}
      </Container>
    
  );
}

export default Usuarios;
